import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/home";
import Register from "./pages/register/Register";
import Login from "./pages/login/Login";
import Music from "./pages/music/Music";
import Search from "./pages/search/Search";
import Library from "./pages/library/Library";
import Profile from "./pages/profile/Profile";

// import UpdateMusic from "./pages/UpdateMusic";
// import UpdateProfile from "./pages/mypage";

// import Upload from "./pages/Upload";
import { useCookies } from "react-cookie";
import { useEffect, useState } from "react";
import { useRecoilState } from "recoil";
import { cookieState } from "./atoms";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                {/* <Route path="/upload" element={<Upload />} /> */}
                <Route path="/join" element={<Register />} />
                <Route path="/login" element={<Login />} />
                <Route path="/" element={<Home />} />
                <Route path="/profile/:id" element={<Profile />} />
                <Route path="/library/:id" element={<Library />} />
                <Route path="/:id" element={<Music />} />
                <Route path="/search" element={<Search />} />
                {/* <Route path="/profile/:id/update" element={<UpdateProfile />} /> */}
                {/* <Route path="/:id/update" element={<UpdateMusic />} /> */}
            </Routes>
        </BrowserRouter>
    );
}

export default App;
